import React from "react";
import { Navigate } from "react-router-dom";
import { useAuth } from "./AuthContext";

const PrivateRoute = ({ children }) => {
  const { user } = useAuth();

  return user ? <>{children}</> : <Navigate to="/loginpage" />;
};

export default PrivateRoute;
